{
  "company_summary": "Linear ist ein SaaS‑Tool zum Planen und Bauen von Softwareprodukten, spezialisiert auf Issue‑ und Projekt‑Tracking sowie Produkt‑Roadmaps. Die Plattform kombiniert eine schnelle, designorientierte Oberfläche mit Integrationen (z. B. Figma, GitHub), einer öffentlichen API und mobilen Apps. Linear bietet zudem KI‑Agenten und Automatisierungen, um Routineaufgaben in Produktprozessen zu delegieren. Das Unternehmen arbeitet vollständig remote und betont Performance, Software‑Handwerkskunst sowie Enterprise‑gerechte Sicherheitsstandards (SOC 2, GDPR, HIPAA).",
  "what_they_sell": [
    "Issue‑ und Task‑Tracking optimiert für Produktteams (Sprints, Cycles, Triage)",
    "Produktplanung und Roadmapping (Initiatives, Milestones, Project Overviews)",
    "KI‑Agenten und AI‑gestützte Automatisierungen für Produktarbeit (z. B. Code‑/Triage‑Agenten)",
    "Integrationen und API (z. B. Figma, GitHub, über 100 Integrationen, GraphQL API/TypeScript SDK)",
    "Mobile und Desktop Apps für produktives Arbeiten unterwegs",
    "Enterprise‑Funktionen und Compliance (SOC 2, GDPR, HIPAA) sowie Integrationen für Firmenworkflows"
  ],
  "likely_users": [
    "Moderne Produktteams (Produktmanager, PM‑Teams)",
    "Software‑Entwicklungsteams / Entwickler",
    "Design‑ und Engineering‑Teams, die eng zusammenarbeiten",
    "Startups bis hin zu etablierten Unternehmen / Enterprise‑Teams"
  ],
